import "./Base.scss";
import { AuthProvider } from "./firebase/Authenticator";
// import { getDatabase, ref, child, get } from "firebase/database";
// import { getDatabase, ref, onValue } from "firebase/database";
import { BrowserRouter as Router, Route } from "react-router-dom";
import MainContainer from "./containers/MainContainer";
// import Header from "./components/Header/Header";
import PrivateRoute from "./firebase/PrivateRoute";
import LoginContainer from "./containers/LoginContainer";
import SignUpContainer from "./containers/SignUpContainer";
import AccountDetails from "./components/SignUp/AccountDetails";

function Base() {

    return (
        <AuthProvider>
            <Router>
                {/* <Header /> */}
                <PrivateRoute exact path={"/"} component={MainContainer} />
                <Route exact path="/login" component={LoginContainer} />
                <Route exact path="/signup" component={SignUpContainer} />
                <Route exact path="/signup" component={AccountDetails} />
            </Router>
        </AuthProvider>
    )
}

export default Base;
